import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import AddAirplaneForm from './components/AddAirplaneForm';
import ViewAirplanes  from './components/ViewAirplanes';


export default function App() {
  return (
    <BrowserRouter>
      <nav style={{ margin: '1em' }}>
        <Link to="/"                style={{ marginRight: '1em' }}>Home</Link>
        <Link to="/add-airplane"    style={{ marginRight: '1em' }}>Add Airplane</Link>
        <Link to="/view-airplanes">View Airplanes</Link>
      </nav>

      <Routes>
        {/* 1) Home route */}
        <Route path="/" element={<p>Select an action above.</p>} />

        {/* 2) Your two pages */}
        <Route path="/add-airplane" element={<AddAirplaneForm />} />
        <Route path="/view-airplanes" element={<ViewAirplanes />} />

        {/* 3) Catchâ€‘all for bad URLs */}
        <Route path="*" element={<p>Page not found</p>} />
      </Routes>
    </BrowserRouter>
  );
}
